window.bookSummaryJSON = "<p><b>New powers. New worlds. New enemies. </b></p> <p>A threat looms on the horizon in the form of a super with unthinkable power. Corbin’s world is changing faster than he can keep up with. Luckily, he has Seena by his side. Even better, she has a few new tricks up her sleeve. </p> <p><b>Freedom comes at a cost. </b></p> <p>The VRC has a revolution to deal with. Corbin and Seena must gain the help of the most influential person in the VRC while ensuring no one finds out where they got their powers from. Also, who is this representative from the Citadel?</p>"; 
